Hitler: A Profile

Biography Documentary hosted by David Ritchie, published by SBS in 1995 - English narration


Information
------------------------------

No other person in the twentieth century has triggered more discussions among biographers and historians than Adolf Hitler. More than 120.000 books and articles on the dictator that have appeared in the past 50 years have documented the full extent of the most horrible crimes in history that were committed by him and his followers. Developed with the assistance of internationally renowned historians, using newly discovered documents, films, sound recordings and interviews with eye-witnesses, relatives, and victims, 'Hitler - A Profile' is the first comprehensive television portrait of the German dictator. Each episode focuses on one character aspect of the man who plunged an entire nation into collective madness and unparalleled savagery.

Executive Producer : Guido Knopp
Music : Klaus Doldinger
A Broadcast of ZDF In Association with ARTE and SBS TV Australia

6)  Criminal 
A look at the horrific policies that Hitler made flesh after his rise to the level of Fuehrer in Germany. His ideas had been formed years before when he was an alienated, penniless youth in Austria reading obscure right-wing philosophers who preached Aryan supremacy. Hitler started his cleansing on the mentally ill in his own country until the Church objected - an objection that was particularly muted when he turned his attention to the Jews. The episode also reveals that, as his power began to slip away in 1945, he issued the infamous 'Nero Order', dictating that everything in Germany was to be destroyed.

